import React from 'react';
import {Container, Nav, Navbar} from "react-bootstrap";
import {BrowserRouter as Router, Link, Route, Routes} from "react-router-dom";
import App from "../App";
import TaskList from "./TaskList";

export default class Header extends React.Component{
    render(){
        return (
            <>
                <Navbar sticky="top" bg="dark" expand="lg" variant="dark">
                    <Container>
                        <Navbar.Toggle aria-controls="basic-navbar-nav" />
                        <Navbar.Collapse id="basic-navbar-nav">
                            <Nav className="me-auto">
                                <Nav.Link as={Link} to="/">Главная</Nav.Link>
                                <Nav.Link href="/request">Запросы</Nav.Link>
                                <Nav.Link href="/new-employee">Регистрация нового сотрудника</Nav.Link>
                                <Nav.Link href="/new-manager">Регистрация нового менеджера</Nav.Link>
                            </Nav>
                        </Navbar.Collapse>
                    </Container>
                </Navbar>
                <Router>
                    <div>
                        <Routes>
                            <Route path="/" element={<TaskList />} />
                            <Route path="/request" element={<App/>}/>
                            <Route path="/new-employee" element={<App/>} />
                            <Route path="/new-manager" element={<App/>} />
                        </Routes>
                    </div>

                </Router>
            </>
        );
    }
}
